INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2834, 0, "ペコリーヌとの出会い", 5118061, 10118, "フリーマーケット会場", 0, 2, "青空の下で謁見", 7, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2835, 0, "マホとの出会い", 5118062, 10118, "フリーマーケット会場", 0, 2, "未来の騎空団\nマスコット？", 7, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2837, 0, "アキノとの出会い", 5118063, 10118, "ランドソル市街地", 0, 2, "お嬢さまからの\n緊急依頼", 7, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4108402, 0, "ジュンとの出会い", 5118064, 10118, "フリーマーケット会場", 0, 2, "黄金色の悩みごと", 18, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4107402, 0, "カオリとの出会い", 5118065, 10118, "フリーマーケット会場", 0, 2, "白熱！　格闘大会！", 18, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (9000227, 0, "ニノンとの出会い", 5118066, 10118, "オーエド町", 1, 2, "祭り太鼓はオーエドの華", 16, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2101181, 0, "スズナとの出会い", 5118067, 10118, "フリーマーケット会場", 0, 3, "人気者は遅れて\nやってくる", 19, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4109402, 0, "ナナカとの出会い", 5118068, 10118, "ランドソル市街地", 0, 3, "巫女・ミーツ・魔法少女", 18, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4305402, 0, "キャル＆コッコロとの出会い", 5118069, 10118, "フリーマーケット会場", 0, 3, "ネズ耳は二度なくなる", 18, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4101402, 0, "ユカリとの出会い", 5118070, 10118, "ランドソル市街地", 0, 3, "この出会いにカンパイ！", 18, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (4106402, 0, "アオイとの出会い", 5118071, 10118, "ランドソル市街地", 0, 3, "陰陽アンサンブル", 18, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 8, 40, 91002, 1);
INSERT INTO `v1_8129bff7206a00666efca27c1868704b2e546bd5bd1bd447fa549ba2cf73f571` VALUES (2836, 0, "シノブとの出会い", 5118072, 10118, "フリーマーケット会場", 1, 3, "運試し十番勝負！", 7, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 8, 40, 91002, 1);
